const isAuth = async () => {
    return await fetch('http://localhost:8080/api/auth', { credentials: "include", method: "GET" })
        .then(async (response) => {
            if (response.status === 401) {
                return false
            }
            if (response.status === 202) {
                return true
            }
        })
}

export default isAuth
